import {
  Column,
  Stack,
  Card,
  Box,
  Columns,
  Inline,
  Placeholder,
  Tiles,
  Text,
  ButtonIcon,
} from 'braid-design-system';
import { Component } from 'react';

export class Game extends Component {
  render() {
    return (
      <Tiles space='large' columns={{ mobile: 4, desktop: 4 }}>
        <ButtonIcon icon='IconAdd'></ButtonIcon>
      </Tiles>
    );
  }
}
